import React, { useState, useEffect } from 'react';
import Suscribir from './Suscribir';

const Suscripciones = () => {
  const [fecha, setFecha] = useState('');
  const [empleado, setEmpleado] = useState('');
  const [nombreCliente, setNombreCliente] = useState('');
  const [apellidoCliente, setApellidoCliente] = useState('');
  const [telefonoCliente, setTelefonoCliente] = useState('');
  const [empleados, setEmpleados] = useState([]);

  useEffect(() => {
    // Obtener la lista de empleados desde la API
    fetch('http://localhost:3005/api/empleados')
      .then((response) => response.json())
      .then((data) => setEmpleados(data))
      .catch((error) => console.error('Error al obtener empleados:', error));
  }, []);

  // Función para manejar la suscripción
  const handleSuscripcion = (e) => {
    e.preventDefault();

    // Verificar si todos los campos están completos
    if (!nombreCliente || !apellidoCliente || !telefonoCliente || !fecha || !empleado) {
      alert('Por favor complete todos los campos');
      return;
    }

    // Crear el objeto cliente
    const nuevoCliente = {
      nombre: nombreCliente,
      apellido: apellidoCliente,
      telefono: telefonoCliente,
    };

    // Enviar la solicitud para suscribir al cliente
    fetch('http://localhost:3006/api/clientes/suscribir', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        fecha,
        empleado,
        cliente: nuevoCliente,
      }),
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.mensaje) {
          alert(data.mensaje);
        }
      })
      .catch((error) => {
        console.error('Error al suscribir cliente:', error);
        alert('Error al suscribir cliente');
      });
  };

  return (
    <div className="container my-5">
      <h2>Suscribir Cliente</h2>

      <form onSubmit={handleSuscripcion}>
        <div className="mb-3">
          <label htmlFor="fecha" className="form-label">Fecha</label>
          <input
            type="date"
            id="fecha"
            value={fecha}
            onChange={(e) => setFecha(e.target.value)}
            className="form-control"
            required
          />
        </div>

        <div className="mb-3">
          <label htmlFor="empleado" className="form-label">Empleado</label>
          <select
            id="empleado"
            value={empleado}
            onChange={(e) => setEmpleado(e.target.value)}
            className="form-control"
            required
          >
            <option value="">Selecciona un empleado</option>
            {empleados.map((empleado) => (
              <option key={empleado._id} value={empleado._id}>
                {empleado.nombre}
              </option>
            ))}
          </select>
        </div>

        <div className="mb-3">
          <label htmlFor="nombreCliente" className="form-label">Nombre Cliente</label>
          <input
            type="text"
            id="nombreCliente"
            value={nombreCliente}
            onChange={(e) => setNombreCliente(e.target.value)}
            className="form-control"
            required
          />
        </div>

        <div className="mb-3">
          <label htmlFor="apellidoCliente" className="form-label">Apellido Cliente</label>
          <input
            type="text"
            id="apellidoCliente"
            value={apellidoCliente}
            onChange={(e) => setApellidoCliente(e.target.value)}
            className="form-control"
            required
          />
        </div>

        <div className="mb-3">
          <label htmlFor="telefonoCliente" className="form-label">Teléfono Cliente</label>
          <input
            type="text"
            id="telefonoCliente"
            value={telefonoCliente}
            onChange={(e) => setTelefonoCliente(e.target.value)}
            className="form-control"
            required
          />
        </div>

        <button type="submit" className="btn btn-primary">Suscribir Cliente</button>
      </form>
    </div>
  );
};

export default Suscripciones;
